import React from 'react';

function TrendAnalysis({ trend }) {
  return (
    <div className="trend-analysis">
      <h2>Hottest Trend Analysis</h2>
      <pre>{trend}</pre>
      <p><small>Retrieved using Tiktok API - Video Object</small></p>
    </div>
  );
}

export default TrendAnalysis;
